import React, { useState } from "react";
import "./Body.css";

const Body = () => {
  const [state, setState] = useState({
    name: "",
    gender: "",
    birth: "",
    bio: "",
  });

  const handleOnChange = (e) => {
    setState({
      ...state,
      [e.target.name]: e.target.value,
    });
  };

  return (
    <div>
      <input
        name="name"
        type="text"
        value={state.name}
        onChange={handleOnChange}
      />
      <select name="gender" value={option} onChange={handleOnChange}>
        <option key={"여성"}>여성</option>
        <option key={"남성"}>남성</option>
      </select>
      <input name="birth" type="date" value={birth} onChange={handleOnChange} />
      <textarea name="bio" value={text} onChange={handleOnChange}></textarea>
    </div>
  );
};

export default Body;
